  const { data: Ldata } = useNormalQueryGet(
    "http://127.0.0.1:8000/user/laboratory/thumbnail?amount=10",
    "laboratory"
  );
  React.useEffect(() => {
    if (Ldata) {
      dispatch(mainAction.setLabData(Ldata));
    }
    // if (data2) {
    //   console.log("data2", data2);
