  //edit -> select

  const location = useLocation();
  switch (location.pathname) {
    case "/admin":
      if (highestRole === "Admin") {
        return (
          <>
            <Modal2 componentTitle="yep" />
            {/* <DynamicForm frame={createFrame.createEvent} />
            <DynamicForm frame={createFrame.createResearch} /> */}

