            <RecentEvents
              toFetchedData={exampleToFetchData.recentEvents}
              ComponentTitle="All Events"
            />
          </>
        );
      } else if (highestRole === "Researcher") {
        const data2 = data?.Researcher?.Laboratories?.[0]?.LID;
